    public String getLoanAmount() {
        if(!TextUtils.isEmpty(loanAmount)) {
            int k = loanAmount.indexOf(".");
            if(loanAmount.length() > (k+3))
                loanAmount =  loanAmount.substring(0,k+3);

            if(k >3 ) {
                return  "$"+loanAmount.substring(0, (k - 3)) + ',' + loanAmount.substring((k - 3), loanAmount.length());
            }else
                return "$"+loanAmount.substring(0,k+3);
            }
        return loanAmount;
    }

    public String getsaleAmount() {
        if(!TextUtils.isEmpty(salesPrice)) {
            int k = salesPrice.indexOf(".");
            if(salesPrice.length() > (k+3))
                salesPrice =  salesPrice.substring(0,k+3);

            if(k >3 ) {
                return  "$"+salesPrice.substring(0, (k - 3)) + ',' + salesPrice.substring((k - 3), salesPrice.length());
            }else
                return "$"+salesPrice;

        }
        return salesPrice;
    }


